import L from 'leaflet';

const iconTractor = new L.Icon({
    iconUrl: require('../../images/tractor.png'),
    iconRetinaUrl: require('../../images/tractor.png'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(20, 20),
    className: 'leaflet-div-icon'
});

const iconDrone = new L.Icon({
    iconUrl: require('../../images/drone.png'),
    iconRetinaUrl: require('../../images/drone.png'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(20, 20),
    className: 'leaflet-div-icon'
});

export { iconTractor, iconDrone };
